import { ToggleButton, ToggleButtonGroup } from "@mui/material"
import React from "react"

import { puzzleInputs } from "../../utils/PuzzleInputs"

const options = Object.keys(puzzleInputs[14]).reduce((result, key) => ({
    [key]: key,
}))
console.log('options: ', options)

const useVersionState = initialValue => {
    const [version, setVersion] = React.useState(initialValue)
    return {
        version,
        setVersion,
    }
}

const VersionToggle = ({ versionState: { version, setValue } }) => {
    return <ToggleButtonGroup
        value={version}
        exclusive
        onChange={event => setValue(event.target.value)}
    >
        {Object.values(options).map(version => (
            <ToggleButton value={version} key={version}>
                {version}
            </ToggleButton>
        ))}
    </ToggleButtonGroup>
}

export default VersionToggle
export {
    useVersionState,
    options,
}
